import React, { useState } from 'react'
import './css/pord_sell_obj.css'
import addcart from '../../img/svg/cartadd.svg'
import favlist from '../../img/svg/favlist.svg'
import { useAuth } from '../../backend/utils/AuthContext';
import { addToCart, addToList } from '../../backend/utils/JsonUtils.js';

export default function PordSellObj({id, Name, Autor, Sinopsis, Costo, ImgURL}) {
    const {isLogged} = useAuth()
    const [cant, setCant] = useState(1)
    const [see, setSee] = useState(false)

    const handleQuantityChange = (val) => {
        setCant(prevCant => Math.max(prevCant + val, 1)); 
    };

    const showMore = () => {
        setSee(prevSee => !prevSee);
    }

    return(
        <>
            <article id='product'>
                <figcaption className='product_image'>
                    <img src={ImgURL} alt={Name} />
                </figcaption>
                <section id='product_info'>
                    <p className='title'>{Name}</p>
                    <p className='secondary'>${Costo}</p>
                    <p className='title'>Escritor/es:</p>
                    <p className='secondary'>{Autor}</p>
                        {
                            isLogged ? (
                                <div id='product_opc_panel'>
                                    <button onClick={() => addToCart(id)} className='product_btn' id='product_buy'><img src={addcart} alt='Cart'/>Agregar al carrito</button>
                                    <p>
                                        <button className='list_cant_btn' onClick={() => handleQuantityChange(-1)}>&lt;</button>
                                        <span className='list_cant_dis'>{cant}</span>
                                        <button className='list_cant_btn' onClick={() => handleQuantityChange(1)}>&gt;</button>
                                    </p>
                                    <button onClick={() => addToList(id)} className='product_btn' id='product_save'><img src={favlist} alt='Favoritos'/>Guardar</button>
                                </div>
                            ) : <h3>Inicie sesi√≥n para realizar compras</h3>
                        }
                </section>
            </article>
            {
                see ? (
                    <section className='see' id='see_true'>
                        <h3>Sinopsis: <sup onClick={showMore}>Mostrar menos</sup></h3>
                        <pre>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed dictum nunc in arcu dictum, ac fermentum lorem lobortis. Praesent tortor sem, cursus in erat at, dictum mollis justo. Praesent vestibulum ligula quis laoreet facilisis. Integer placerat tempus risus, ut luctus lectus. Aenean ac congue orci. Etiam vitae ante erat. In imperdiet, elit eget sollicitudin molestie, dui quam vestibulum eros, dignissim interdum diam nulla id mi. Proin et aliquam erat. Nam et massa et nisi maximus vestibulum vitae luctus neque. Vestibulum purus nibh, facilisis nec eros sit amet, eleifend semper urna. Nunc tellus erat, lacinia sed ultrices nec, suscipit vel dui. Integer vel elit sit amet lacus aliquam fringilla elementum ut dui.

                            Etiam mattis nunc non neque fermentum, a ultrices purus fermentum. Ut commodo nisl ac gravida sollicitudin. Maecenas ut diam ante. Integer congue ac nisi in dapibus. Sed iaculis quam sed nisi tincidunt mattis. Aliquam volutpat facilisis lacus, ac varius eros dictum mattis. Duis efficitur gravida justo, eget iaculis nibh consectetur sit amet.

                            In ac ultrices erat. Nunc a scelerisque nisl. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc non fringilla odio. Nulla facilisi. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Nam lacus elit, placerat quis leo eu, eleifend accumsan dui. Praesent quam diam, gravida ac blandit porta, accumsan a dolor. Duis fringilla ipsum id feugiat lobortis. Sed tristique tempor turpis, eu porta purus cursus sit amet. Integer ante turpis, iaculis eu justo sit amet, cursus tristique ligula. Etiam in neque in ex pretium gravida sit amet ac mauris. Praesent mi elit, pretium vel congue id, vehicula sed risus. Vivamus in faucibus dui.

                            Nullam sed erat lectus. Phasellus eget tincidunt enim. Proin mattis, risus vitae congue elementum, elit mauris venenatis dolor, at ultricies elit metus id lacus. Maecenas laoreet id diam at gravida. Donec purus diam, maximus at massa eu, sollicitudin pharetra est. Nullam eleifend eu lectus eu rhoncus. Nam quis turpis vel eros condimentum commodo id non quam. Pellentesque ipsum tortor, pharetra id porta id, fringilla et ante. Nulla massa sapien, blandit a risus ac, volutpat feugiat nulla. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus ultrices pulvinar nunc, ut posuere turpis aliquet eget. Aliquam id velit semper, rutrum neque at, efficitur nisi. Pellentesque faucibus justo odio, eget imperdiet tortor convallis non. Phasellus tristique vehicula libero id viverra.

                            </pre>
                    </section>
                ) : (
                    <section className='see' id='see_false'>
                        <h3 onClick={showMore} id='seeless'>Ver la sinnopsis</h3>
                    </section>
                )
            }
        </>
    )
}
